import React, { useEffect, useRef } from "react";

export const ReactionMonitoringP5Image = (props) => {
  const ref = useRef(null);

  useEffect(() => {
    console.log("DATA passed:", props.data);
  }, [props.data]);

  return (
    <div id="reactionMonitoringP5Image" className="text-center">
      <div className="container">
        <div className="col-md-12" ref={ref}>
          {props.data && props.data.length > 0
            ? props.data.map((d, i) => (
                <div key={`${d.title}-${i}`} className="animated rmPage5_Img">
                  <h3>{d.title}</h3>
                  <div className="spacer"></div>
                  <div className="row align-items-center">
                    <div className="col-12 col-md-6 fade-in-up scale-up">
                      <img
                        src="img/portfolio/conc-plot.png"
                        className="img-responsive"
                        alt=""
                      />
                      <img
                        src="img/portfolio/predicted-conc.png"
                        className="img-responsive"
                        alt=""
                      />
                    </div>
                  </div>
                </div>
              ))
            : "Loading..."}
        </div>
      </div>
    </div>
  );
};
